<style>
  /* Our custom tooltip */
  #hover-tooltip {
    position: fixed;
    display: none;
    pointer-events: none;
    background: rgba(255, 255, 255, 0.97);
    border: 1px solid #888;
    border-radius: 4px;
    padding: 6px;
    z-index: 1000;
    box-shadow: 0 2px 6px rgba(0,0,0,0.3);
    font-size: 11px;
  }
  #hover-text {
    font-size: 10px;            /* <--- BIGGER TEXT */
    text-align: center;         /* <--- CENTERED TEXT */
    margin-bottom: 10px;        /* <--- spacing above image */
    font-weight: 500;           /* optional: slightly bold */
    line-height: 1.3;           /* cleaner multiline spacing */
  }
  #hover-tooltip img {
    display: block;
    max-width: 400px;
    height: auto;
  }
</style>

<div id="hover-tooltip">
  <div id="hover-text"></div>   <!-- THIS MUST EXIST -->
  <img id="hover-img" src=""/>
</div>

<script>
  document.addEventListener("DOMContentLoaded", function() {
    var plot = document.getElementById("pca_plot");
    var tooltip = document.getElementById("hover-tooltip");
    var tooltipImg = document.getElementById("hover-img");
    var tooltipText = document.getElementById("hover-text");   //  new

    plot.on("plotly_hover", function(e) {
      var pt = e.points[0];

      //  Insert parameter text
      // tooltipText.innerHTML = "Parameters:<br>" + pt.hovertext;    

      //  Insert image
      tooltipImg.src = pt.customdata;

      var ev = e.event;
      var padding = 20;

      tooltip.style.display = "block";
      tooltip.style.left = "0px";
      tooltip.style.top  = "0px";

      var tooltipRect = tooltip.getBoundingClientRect();
      var viewportWidth  = window.innerWidth;
      var viewportHeight = window.innerHeight;

      var x = ev.clientX + padding;
      var y = ev.clientY + padding;

      if (x + tooltipRect.width > viewportWidth) {
        x = ev.clientX - tooltipRect.width - padding;
      }
      if (y + tooltipRect.height > viewportHeight) {
        y = ev.clientY - tooltipRect.height - padding;
      }

      tooltip.style.left = x + "px";
      tooltip.style.top  = y + "px";
    });

    plot.on("plotly_unhover", function(e) {
      tooltip.style.display = "none";
    });

    plot.on("plotly_click", function(e) {
      var pt = e.points[0];
      var textToCopy = pt.hovertext || "";

      if (!textToCopy) {
        return;
      }

      if (navigator.clipboard && navigator.clipboard.writeText) {
        navigator.clipboard.writeText(textToCopy)
          .then(function() {
            // Simple visual confirmation  tweak or remove as you like
            console.log("Copied to clipboard:", textToCopy);
            // e.g. brief toast:
            // alert("Copied to clipboard!");
          })
          .catch(function(err) {
            console.error("Clipboard write failed:", err);
          });
      } else {
        // Fallback for older browsers
        var temp = document.createElement("textarea");
        temp.value = textToCopy;
        document.body.appendChild(temp);
        temp.select();
        try {
          document.execCommand("copy");
          console.log("Copied to clipboard (fallback):", textToCopy);
        } catch (err) {
          console.error("execCommand copy failed:", err);
        }
        document.body.removeChild(temp);
      }
    });
  });
</script>



</body>
</html>
